  false,\n\t\"url\": null,\n\t\"notes\": \"Through an active role in local, state,
  and federal partnerships, the refuge staff works to maintain the ecological integrity
  and water quality of the Willapa Bay estuary. As with other natural estuarine habitats,
  this area is subject to natural processes; therefore, little if any physical management
  actions are necessary for existing open water areas. A portion of the open water
  habitat of the Willapa Bay estuary is within the designated boundaries of the Refuge.
  The refuge staff works in concert with the community and other agencies to provide
  the necessary monitoring, protection, resources, and educational information, to
  maintain the Willapa Bay ecosystem in a healthy sustainable manner.\",\n\t\"license_title\":
